INSERT {
  name: @name,
  nse_symbol: @symbol
} INTO companies
RETURN NEW

LET m = (
  INSERT {
    metric_name: @metric_name,
    value: @value,
    unit: @unit,
    denomination: @denomination,
    source_page: @source_page
  } INTO metrics
  RETURN NEW
)[0]

INSERT {
  _from: @filing_id,
  _to: m._id
} INTO filing_has_metric

RETURN m

